import {
  Action,
  createFeatureSelector,
  createReducer,
  createSelector,
  on
} from '@ngrx/store';
import { EntityState, EntityAdapter, createEntityAdapter } from '@ngrx/entity';
import * as PetsActions from './pets.actions';
import { AppState } from '../core.state';
import { Pet } from './pets.model';

export const petsFeatureKey = 'pets';

export interface PetsState extends EntityState<Pet> {
  // additional entities state properties
}

export const adapter: EntityAdapter<Pet> = createEntityAdapter<Pet>();

export const initialState: PetsState = adapter.getInitialState({
  // additional entity state properties
  ids: ['id-pet-1', 'id-pet-2', 'id-pet-3'],
  entities: {
    'id-pet-1': {
      id: 'id-pet-1',
      avatar:
        'data:image/jpeg;base64,',
      name: 'Lecy',
      type: 'dog',
      breed: 'Buldog',
      color: 'yellow',
      status: 'interned',
      tutorId: 'id-person-1',
      treatments: ['id-treatment-1', 'id-treatment-2'],
      qrCode: ''
    },
    'id-pet-2': {
      id: 'id-pet-2',
      avatar:
        'data:image/jpeg;base64,',
      name: 'boby',
      type: 'dog',
      breed: 'poodle',
      color: 'white',
      status: 'in-home',
      tutorId: 'id-person-1',
      treatments: ['id-treatment-3', 'id-treatment-4'],
      qrCode: ''
    },
    'id-pet-3': {
      id: 'id-pet-3',
      avatar: '',
      name: 'Rufus',
      type: 'cat',
      breed: 'Angora',
      color: 'black',
      status: 'in-home',
      tutorId: 'id-person-2',
      treatments: ['id-treatment-5'],
      qrCode: ''
    }
  }
});

const reduce = createReducer(
  initialState,
  on(PetsActions.addPet, (state, action) => adapter.addOne(action.pet, state)),
  on(PetsActions.upsertPet, (state, action) =>
    adapter.upsertOne(action.pet, state)
  ),
  on(PetsActions.addPets, (state, action) =>
    adapter.addMany(action.pets, state)
  ),
  on(PetsActions.upsertPets, (state, action) =>
    adapter.upsertMany(action.pets, state)
  ),
  on(PetsActions.updatePet, (state, action) =>
    adapter.updateOne(action.pet, state)
  ),
  on(PetsActions.updatePets, (state, action) =>
    adapter.updateMany(action.pets, state)
  ),
  on(PetsActions.deletePet, (state, action) =>
    adapter.removeOne(action.id, state)
  ),
  on(PetsActions.deletePets, (state, action) =>
    adapter.removeMany(action.ids, state)
  ),
  on(PetsActions.loadPets, (state, action) =>
    adapter.addAll(action.pets, state)
  ),
  on(PetsActions.clearPets, (state) => adapter.removeAll(state))
);

export function petsReducer(state: PetsState | undefined, action: Action) {
  return reduce(state, action);
}

export const {
  selectIds,
  selectEntities: petsEntities,
  selectAll: allPets
} = adapter.getSelectors((state: AppState) => state.pets);

// select the array of pets ids
export const selectPetsIds = selectIds;

// select the dictionary of pets entities
export const selectPetEntities = petsEntities;

// select the array of pets
export const selectAllPets = allPets;

export const selectPet = createSelector(
  petsEntities,
  (entities, props: string) => entities[props]
);

export const selectPetsByIds = createSelector(
  petsEntities,
  (entities, props: string[]) => props.map((id) => entities[id])
);

export const selectPetsByIdsForListComponent = createSelector(
  petsEntities,
  (entities, props: string[]) => {
    return {
      data: props.map((id) => {
        return {
          id: entities[id].id,
          column1: entities[id].avatar,
          column2: entities[id].name,
          column3: `${entities[id].type} ${entities[id].breed} ${entities[id].color}`,
          column4: entities[id].status
        };
      }),
      info: {
        id: {
          included: false,
          label: '',
          sort: false,
          onlyQuery: false,
          width: ''
        },
        column1: {
          included: true,
          type: 'image',
          label: '',
          sort: false,
          onlyQuery: false,
          width: '70px'
        },
        column2: {
          included: true,
          type: 'string',
          label: 'Name',
          sort: true,
          onlyQuery: false,
          width: ''
        },
        column3: {
          included: true,
          type: 'string',
          label: 'Informaes',
          sort: true,
          onlyQuery: false,
          width: ''
        },
        column4: {
          included: true,
          type: 'string',
          label: 'Status',
          sort: true,
          onlyQuery: false,
          width: ''
        }
      }
    };
  }
);
